import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import './index.css'
import './normalize.css'
import {BrowserRouter} from "react-router-dom";

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <div className="index">
        <BrowserRouter>
            <App/>
        </BrowserRouter>
    </div>
)
